package com.example.antriankesehatan.modelimport com.google.gson.annotations.SerializedNamedata class RegisterResponse(	@field:SerializedName("data")	val data: Data? = null,	@field:SerializedName("meta")	val meta: Meta? = null)data class User(	@field:SerializedName("photoProfile")	val photoProfile: Any? = null,	@field:SerializedName("no_tlp")	val noTlp: String? = null,	@field:SerializedName("updated_at")	val updatedAt: String? = null,	@field:SerializedName("roles")	val roles: String? = null,	@field:SerializedName("name")	val name: String? = null,	@field:SerializedName("created_at")	val createdAt: String? = null,	@field:SerializedName("email_verified_at")	val emailVerifiedAt: Any? = null,	@field:SerializedName("id")	val id: Int? = null,	@field:SerializedName("jenis_kelamin")	val jenisKelamin: String? = null,	@field:SerializedName("email")	val email: String? = null,	@field:SerializedName("alamat")	val alamat: String? = null)data class Data(	@field:SerializedName("access_token")	val accessToken: String? = null,	@field:SerializedName("token_type")	val tokenType: String? = null,	@field:SerializedName("user")	val user: User? = null)data class Meta(	@field:SerializedName("code")	val code: Int? = null,	@field:SerializedName("message")	val message: String? = null,	@field:SerializedName("status")	val status: String? = null)